{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/gregorygibbons/bellabeat-case-study?scriptVersionId=194334036\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"24960a67","metadata":{"_cell_guid":"c7a9088c-2b05-40c9-b95a-754bae787091","_uuid":"9acc2c15-e8ce-4d27-b413-3dcc4de5d7d8","papermill":{"duration":0.009807,"end_time":"2024-08-27T22:17:56.004325","exception":false,"start_time":"2024-08-27T22:17:55.994518","status":"completed"},"tags":[]},"source":["\n","## Introduction\n","\n","I am a junior data analyst, working with Bellabeat on a marketing analysis team, a manufacturer of health-focused products for women. I have been asked to focus on one of Bellabeat’s products, analyze provided data to gain insights on how smart devices are used. The insights gained from my analysis will help guide Bellabeat’s marketing strategy. My findings and recommendations will be presented to the Bellabeat executive team. The products in question are the Bellabeat app, Leaf (a classic wellness tracker than can be worn as a bracelet, necklace, or clip), Time (a smart watch that tracks activity), and Spring (a water bottle that tracks daily water intake). All of these products connect to the app to track a variety of statistics from steps, to calories, to hydration, to sleep.\n","\n","## Phase 1, ASK\n","Identify trends in how consumers use smart devices to apply insights into Bellabeat’s marketing strategy.\n","\n","**Stakeholders** \n","\n","+ Urška Sršen - Bellabeat’s co founder and Chief Creative Officer\n","\n","+ Sando Mur - Bellabeat’s co founder; key member of the Bellabeat executive team\n","\n","+ Bellabeat marketing analytics team\n","\n","## Phase 2, PREPARE\n","\n","The data source used is FitBit Fitness Tracker Data. This dataset is stored on Kaggle. Verifying the metadata, we can confirm that it is open-source data. The data was generated by respondents to a distributed survey via Amazon Mechanical Turk between 3/12/2016 - 5/12/2016. Thirty eligible Fitbit users consented to the submission of their personal data. Any variation between output represents use of different types of trackers and individual tracking behaviors. There are 18 CSV files in the set for analysis. Each document represents different quantitative data. Due to the limitations in this data, being as it only has 30 users, and not having any demographic information, we could enounter some sampling bias. I am not sure that the sample is representative of the population as a whole. Another possible problem, is the time limitation of the survey (2 months)."]},{"cell_type":"markdown","id":"612caf84","metadata":{"_cell_guid":"a6a3e346-0ada-4ed9-be0c-fa9f48c5438d","_uuid":"e033bb0e-059d-49ce-9aba-37033fa37ed0","papermill":{"duration":0.008646,"end_time":"2024-08-27T22:17:56.022103","exception":false,"start_time":"2024-08-27T22:17:56.013457","status":"completed"},"tags":[]},"source":["## Phase 3, PROCESS\n","\n","I have decided to use R for this project, considering the amount of raw data that I am working with. The packages I used in this analysis are; \n","- tidyverse \n","- skimr \n","- janitor\n","\n","Now, to set up the environment and install, enable the packages, and import the files"]},{"cell_type":"code","execution_count":1,"id":"d211409d","metadata":{"_cell_guid":"7ba0e737-b3cc-49f8-bfb5-f77935bcdcd1","_uuid":"78ab5e37-9c70-4619-9253-81a8a909739a","collapsed":false,"execution":{"iopub.execute_input":"2024-08-27T22:17:56.04344Z","iopub.status.busy":"2024-08-27T22:17:56.041243Z","iopub.status.idle":"2024-08-27T22:17:57.276463Z","shell.execute_reply":"2024-08-27T22:17:57.274659Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":1.248051,"end_time":"2024-08-27T22:17:57.278745","exception":false,"start_time":"2024-08-27T22:17:56.030694","status":"completed"},"tags":[]},"outputs":[{"nam