\nxQ4AAEATFDsAAABNUOwAAAA0QbEDAADQBMUOAABAExQ7AAAATVDsAAAANEGxAwAA0ATFDgAA\nQBMUOwAAAE1Q7AAAADRBsQMAANAExQ4AAEATFDsAAABNUOwAAAA0QbEDAADQBMUOAABAExQ7\nAAAATVDsAAAANEGxAwAA0ATFDgAAQBMUOwAAAE1Q7AAAADRBsQMAANAExQ4AAEATFDsAAABN\nUOwAAAA0QbEDAADQBMUOAABAExQ7AAAATVDsAAAANEGxAwAA0ATFDgAAQBMUOwAAAE1Q7AAA\nADRBsQMAANAExQ4AAEATFDsAAABNUOwAAAA0QbEDAADQBMUOAABAExQ7AAAATVDsAAAANEGx\nAwAA0ATFDgAAQBMUOwAAAE1Q7AAAADRBsQMAANAExQ4AAEATFDsAAABNUOwAAAA0QbEDAADQ\nBMUOAABAExQ7AAAATVDsAAAANEGxAwAA0ATFDgAAQBMUOwAAAE1Q7AAAADRBsQMAANAExQ4A\nAEATFDsAAABNUOwAAAA0QbEDAADQBMUOAABAExQ7AAAATVDsAAAANEGxAwAA0ATFDgAAQBMU\nOwAAAE1Q7AAAADRBsQMAANAExQ4AAEATFDsAAABNUOwAAAA0QbEDAADQBMUOAABAExQ7AAAA\nTVDsAAAANEGxAwAA0ATFDgAAQBMUOwAAAE1Q7AAAADRBsQMAANAExQ4AAEATFDsAAABNUOwA\nAAA0QbEDAADQBMUOAABAExQ7AAAATVDsAAAANEGxAwAA0ATFDgAAQBMUOwAAAE1Q7AAAADRB\nsQMAANAExQ4AAEATFDsAAABNUOwAAAA0QbEDAADQBMUOAABAExQ7AAAATVDsAAAANEGxAwAA\n0ATFDgAAQBMUOwAAAE1Q7AAAADRBsQMAANAExQ4AAEATFDsAAABNUOwAAAA0QbEDAADQBMUO\nAABAExQ7AAAATVDsAAAANEGxAwAA0ATFDgAAQBMUOwAAAE1Q7AAAADRBsQMAANAExQ4AAEAT\nFDsAAABNUOwAAAA0QbEDAADQBMUOAABAExQ7AAAATfw/9/rdPTaD/KAAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["daily_sleep_percent %>%\n","  ggplot(aes(x = \"\",y = total_percent, fill = user_type)) +\n","  geom_bar(stat = \"identity\", width = 1)+\n","  coord_polar(\"y\", start=0)+\n","  theme_minimal()+\n","  theme(axis.title.x= element_blank(),\n","        axis.title.y = element_blank(),\n","        panel.border = element_blank(), \n","        panel.grid = element_blank(), \n","        axis.ticks = element_blank(),\n","        axis.text.x = element_blank(),\n","        plot.title = element_text(hjust = 0.5, size=14, face = \"bold\")) +\n","  geom_text(aes(label = labels),\n","            position = position_stack(vjust = 0.5))+\n","  scale_fill_manual(values = c( \"#FF3333\",\"#55EA38\",\"#3347FF\"),\n","                    labels = c(\"High user - 21 to 31 days\",\n","                               \"Moderate user - 11 to 20 days\",\n","                               \"Low user - 1 to 10 days\"))+\n","  labs(title=\"Tracked sleep time per day\")"]},{"cell_type":"markdown","id":"e934ea17","metadata":{"_cell_guid":"8faf073e-e88a-45af-adb3-33facef4a04d","_uuid":"222a4a15-1fca-492d-80fc-2a885c2a9d1a","papermill":{"duration":0.024783,"end_time":"2024-08-27T22:18:03.722521","exception":false,"start_time":"2024-08-27T22:18:03.697738","status":"completed"},"tags":[]},"source":["From this visualization, we can see that: \n","\n","+ half of the users use their device frequently, at least 21 days \n","\n","+ 38% are moderate users, using their device between 11-20 days. \n","\n","+ 12% rarely used their devices.\n","\n","Comparing the last 2 visualizations, we see that more users tracked their activity and calories than they did their sleep at a higher rate. More high users with fewer moderate and low users."]},{"cell_type":"markdown","id":"5deb79c5","metadata":{"_cell_guid":"74389019-aa22-4fad-b469-83f087f03051","_uuid":"c4fff097-90eb-4964-83a3-d2c6931aac6d","papermill":{"duration":0.024985,"end_time":"2024-08-27T22:18:03.772291","exception":false,"start_time":"2024-08-27T22:18:03.747306","status":"completed"},"tags":[]},"source":["## Phase 6, ACT & Conclusions\n","\n","Bellabeat was created with the mission of empowering women by providing them with the data to discover more about their health, habits, and bodies.\n","\n","I did an analysis on averages in sleep, daily steps per day, steps taken vs calories burned, and overall app usage for general tracking and those that tracked sleep.\n","\n","After analyzing the data, I will respond to the task of helping Bellabeat on its marketing stragegy; I would advise, for further analysis, we use the data from Bellabeat’s devices. Being that the main target is young and adult women, the datasets provided have a small sample size and could possibly be biased since we have no demographic details of the users. That being said, these are my recommendations for Bellabeat;\n","\n","**Recommendations for the App**\n","\n","+ Provide users with daily notifications on steps taken at the end of the day. According to the NIH, those who walk 8,000 steps during the day have a 50% lower risk of dying from any cause during follow up, when compared to those who only walk 4,000 steps per day. Additionally, people who walk 12,000 steps per day have a 65% lower risk of dying than those who walk 4,000.\n","\n","+ Provide daily notifications on sleep From the results of my analysis, it is easy to see that users sleep less than the recommended amount of sleep. A feature could be implemented that would allow the user to set up a bed time then recieve a notification a specified amount of time before bedtime to set alarms and do their night time ritual.\n","\n","+ Provide other functions based on users needs/desires If the users want to lose weight, controlling calories is a good idea. Bellebeat could suggest some low-calorie foods, or give personalized tips on how to feel full for longer without consuming as many calories.\n","\n","+ Introduce a rewards system A reward system based on level of logged activity could be devised. This system could consist of thresholds to reach, based on steps walked, sleep logged, activity logged, etc, over the course of a week or month. These levels would award the user with a certain amount of stars, with more stars being awarded based on length of activity and consistency in tracking. These stars would be converted into discounts for other Bellabeat products. Either set a fixed amount of stars for a predetermined discount, or one star equals a certain amount off of a product."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":7746251,"sourceType":"datasetVersion"}],"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":10.684891,"end_time":"2024-08-27T22:18:03.91865","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-08-27T22:17:53.233759","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}